I wrote this Triangle class in C#, and I have a function that returns the area, but it's not returning the correct number a lot of the time. It's based on the coordinate geometry formula: area = the absolute value of Ax(By - Cy) + Bx(Cy - Ay) + Cx(Ay - By) divided by 2. Can you help me find the problem?

using System.Windows;
void Main()
{
	var t = new Triangle(new Point(0,0), new Point(0,2),new Point(2,0));
	Console.WriteLine(t.Area);//expected 2

	t = new Triangle(new Point(10,17), new Point(25,5),new Point(28,19));
	Console.WriteLine(t.Area);//expected 123
}

class Triangle
{
	private Point v1, v2, v3;

	public Triangle(Point v1, Point v2, Point v3)
	{
		this.v1 = v1;
		this.v2 = v2;
		this.v3 = v3;
	}

	public double Area
	{
		get
		{			
			return Math.Abs(v1.X * (v2.Y - v3.Y) + 
			v2.X * (v3.Y - v1.Y) + 
			v3.X * (v1.Y - v2.Y) / 2);
		}
	}
}

